import React from 'react';
import ZipInfo from './ZipInfo.js'

function ZipCodes(props) {
    let style_div = {
        display: "flex",
        flexDirection: "row",
        flexWrap: "wrap"
    }

    let style_p = {
        margin: "10px"
    }

    return(
        <div style={style_div}>{
            props.zip_codes.map(function(zip) {
                                return <ZipInfo key={zip} zips={zip} style={style_p} />
            })
        }</div>
    )
}

export default ZipCodes
